import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import * as Icon from 'react-bootstrap-icons';
import Navbar from './Navbar.js';
import './Chennaihospital.css';
import {Container , Row, Col} from 'react-bootstrap';
import Card from 'react-bootstrap/Card';

import { CCard } from '@coreui/react'
import { toBeRequired } from "@testing-library/jest-dom/dist/matchers";

function ChennaiHospital(){
    return(
        <div>
            
            <Navbar />
            <Container className="back" fluid>
                <br></br>
                
                <br>
                </br>
                <br></br>
                <Row justify="around" >
                 <Col md={6}> 
                <Card style={{ width: '500px' }}>
      <Card.Img variant="top" src={require('./apollo.jpg')  } />
      <Card.Body>
        <Card.Title><b><h2 class="display-1">APOLLO HOSPITALS</h2></b></Card.Title>
        <Card.Text><p className="open">
          Address  :<span className="time"> 645, Thiruvottiyur High Rd, Tondiarpet, Chennai, Tamil Nadu 600081</span></p>
        </Card.Text>
        <Card.Text>
            <p className="open">Open Hours : <span className="time">24 HRS</span></p>
        </Card.Text>
        <Card.Text>
            <p className="open">Phone : <span className="time">044 2591 3333</span></p>
        </Card.Text>
        <Card.Text>
            
        </Card.Text>
        
      </Card.Body>
    </Card>
    </Col>  

                    

                </Row>

            </Container>

        
        </div>

    );
}
export default ChennaiHospital;
